bielik_prompt5_translation:
Oto tłumaczenie zdania "What did you say?!" na język polski:

"Co powiedziałeś?!";

To wykrzyknienie jest używane, gdy ktoś nie dosłyszał lub nie zrozumiał wypowiedzi innej osoby i prosi o jej powtórzenie. Może też wyrażać zaskoczenie lub niedowierzanie w to, co zostało powiedziane.
